import Container from './../../node_modules/react-bootstrap/Container';
import Nav from './../../node_modules/react-bootstrap/Nav';
import Navbar from "./../../node_modules/react-bootstrap/Navbar";
import "./../style/HomeNav.css";
import "./../../node_modules/bootstrap/dist/css/bootstrap.min.css"
import { Link } from "react-router-dom";

function HomeNav() {
    return (

            <div className="navbar">
                <div className="navbar-contents">
                    <div className='brand-title'>
                        <Link to='/'>
                        <div className='homenav-logo'><box-icon name='pizza' type='solid' color='#ffffff' size='md'></box-icon></div>
                        <div className="link-text" id='logo'><Navbar.Brand href="#home">Pizza Bruno</Navbar.Brand></div>
                        </Link>
                    </div>
                    <div className='navbar-links'>
                        <Nav className="me-auto">
                        <Nav.Link ><Link to='/' className='link-text'>Home</Link></Nav.Link>
                        <Nav.Link ><Link to='/menu' className='link-text'>Menu</Link></Nav.Link>
                        <Nav.Link ><Link to='/' className='link-text'>Login</Link></Nav.Link>
                        <div className='homenav-cart'><box-icon name='cart-alt' color='#f6f6f6' size='md'></box-icon></div>
                        </Nav>
                    </div>
                </div>
            </div>

    );
}

export default HomeNav
